import React, { Component } from 'react';

const Arrow = (position, left, top) => (
  <div style={{ position: position, left: left, top: top }}>
    <i class='fas fa-arrow-circle-up'></i>
  </div>
);

export class Static extends Component {
  render() {
    return (
      <div>
        <Arrow position='fixed' top='600px' />
      </div>
    );
  }
}

export default Static;
